import { makeStyles } from '@material-ui/core/styles'

export default makeStyles((theme) => ({
    root: {
        flexGrow: 1,
        margin: theme.spacing(1),
    },
    paper: {
        padding: theme.spacing(1),
        color: theme.palette.text.secondary,
    },
    first:{
        fontFamily:'Inter',
        fontStyle:'normal',
        fontWeight: 500,
        fontSize:'16px',
        lineHeight: '19px',
    },
    main: {
        fontWeight: 600,
        fontStyle: 'normal',
        fontFamily: 'Inter',
        fontSize: '30px',
        lineHeight: '36px',
        textAlign: 'center',

    },
}))
